import React from 'react';
import './App.css';
import Button from 'react-bootstrap/Button'
import Jumbotron from 'react-bootstrap/Jumbotron';

function App() {
  return (
    <div className="App">
      <Jumbotron>

      </Jumbotron>
      <div>Hello</div>
      <Button>Morkovka</Button>
    </div>
  );
}

export default App;
